import React from 'react';
import { View,Image } from 'react-native';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons'; 
import Svg,{} from 'react-native-svg';
import { headerstyles } from '../Styles/HeaderStyle';

export default function Header() {
    const svgXml:string = `
      <svg width="7" height="7" viewBox="0 0 7 7" fill="none" xmlns="http://www.w3.org/2000/svg">
        <circle cx="3.5" cy="3.5" r="3.5" fill="#1DB50F"/>
        <circle cx="3.5" cy="3.5" r="1.5" fill="#D9D9D9"/>
      </svg>
    `;
  return (
    <View style={headerstyles.container}>
      <FontAwesomeIcon style={headerstyles.magnifyingglass} icon={faSearch} /> 
      <View style={headerstyles.containerforavatar}>
      <Image source={{uri:"data:image/jpeg;base64,"}} style={headerstyles.avatar}></Image>
      <Svg width={7} height={7} viewBox="0 0 7 7" fill="none" xmlns="http://www.w3.org/2000/svg">
        <Circle cx={3.5} cy={3.5} r={3.5} fill="#1DB50F" />
        <Circle cx={3.5} cy={3.5} r={1.5} fill="#D9D9D9" />
      </Svg>
      </View>
    </View>
  );
}
